/**
 *@overfileView 图片上传业务插件
 *author Yoocky <mengyanzhou@gmail.com>
 */

define(['src/js/core', 'entry/tourpal/js/tourpal'], function(core, tourpal){
       var upload = function (settings) {  
  
            var options = $.extend({  
                fileType: "gif|jpg|jpeg|png|bmp",                       //允许的文件格式  
                uploadUrl: "/index.php/Api/Images/upload",      //上传URL地址    
                width: "",                                              //图片显示的宽度  
                height: 100,                                            //图片显示的高度  
                addSelector: ".add-btn",                                //添加按钮
                listSelector: ".img-list",                              //图片列表容器
                loadingImg : "data:image/gif;base64,",
                successFn: function(){}                                 //返回图片地址，和dom中的
            }, settings);  
            
            //ios初始化
            var initIOS = function(){
                addInput();
                bindEvent();

            }
            // android初始化
            var initAndroid = function(){
                var $imgList = $(options.listSelector); 
                window.successPhoto = function(data){
                    data = JSON.parse(data);
                    //图片loading
                    if(data.action == 0){
                        for(var i = 0; i < data.num; i++){
                            $imgList.prepend('<li ><img src="' + options.loadingImg + '" class="loading"><span class="del">&times;</span></li>');
                        }
                    }
                    //上传成功
                    if(data.action == 1){
                        var picId = data.imgUrl.substr(data.imgUrl.lastIndexOf('/')+1).replace('.jpg', '');
                        $imgList.find('.loading').eq(0).removeClass('loading').attr('src', data.imgUrl).parent().attr('data-picid', picId);

                    }
                }
                $('.add-btn').on('click', function(){ 
                    ElongApp.showPhoto('successPhoto', JSON.stringify({maxNum : 4 - $imgList.find('li').length }));
                });
            }

            //添加input
            var addInput = function(){
                $(options.addSelector).html('<input type="file" name="file"  class="watch-change"/>');
            }

            //验证文件格式  
            var checkFile = function (filename) {  
                   var reg = new RegExp('\.' + options.fileType + '$','i');
                   return reg.test(filename); 
            }  

            //创建表单  
            var createForm = function () {  

                    var form = document.createElement("form");  
                    var id = new Date().getTime();
                    form.action = options.uploadUrl;
                    form.method = "post";  
                    form.enctype = "multipart/form-data";  
                    form.target  = "iframe_" + id;
                    form.style.display = "none";  
                    var $form = $(form);
                    $form.attr('data-id', id);
                    $form.addClass('id_' + id);
                    var $iframe = $('<iframe style="display:none" data-id="' + id + '" name="iframe_' + id + '" class="id_' + id + '"></iframe>');
                    $('body').append($iframe); 
                    $('body').append($form); 
                    return $form;  
            } 
            //上传主函数  
            var bindEvent = function(){
                $('.add-btn').on('change', '.watch-change', function(){  
                    var $this = $(this);    
                    var $imgList = $(options.listSelector);  

                    if ($this.val() === "") {  
                        tourpal.alert.show("请选择要上传的图片！");  
                        return false;  
                    }  
                    //验证图片  
                    if (!checkFile($this.val())) {  
                        tourpal.alert.show("文件格式不正确，只能上传格式为：" + options.fileType + "的文件。");  
                        return false;  
                    }  

                    //创建表单  
                    var $form = createForm();  

                    //把上传控件附加到表单  
                    var formId = $form.attr('data-id'); 
                    $this.appendTo($form);
                    $form.append('<input name="id" value="' + formId  + '">');
                    addInput();
                    $imgList.prepend('<li data-id="' + formId +'"><img src="' + options.loadingImg + '" ><span class="del">&times;</span></li>');

                    //提交
                    $form.submit();
                });
                
                //监听iframe中的图片上传事件
                $(window).on('message', function(e){
                        options.successFn(e.data);
                        var id = e.data.data.id;
                        $('.id_' + id).remove();
                })
            }  
            if(navigator.userAgent.indexOf('Android') > 0){
                //$(options.listSelector).show();
                //initAndroid();
            }else{
                initIOS();
            }
            
        }  
  return upload;
});